import React from "react";
import "./App.css";
import "./app/bootstrap.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function BasicExample() {
  return (
    <Router>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
    </Router>
  );
}

function Home() {
  return (
    <div className="main-container">
     <h6>Areca/ OSMF awareness</h6>
     <p>Creating opportunities for better health decisions</p>
     <a className="search" style={{fontSize: 'larger'}}><Link to="/about">DOWNLOAD HERE</Link></a>
 </div>
  );
}

function About() {
  return (
    <div className="container">
      <h1 style={{background: "#f5f5f5"}}>Areca nut/ OSMF awareness</h1>
    </div>
  );
}
